import React from "react";
import style from "../styleSheets/Hands.module.css";

export default function Hands(props) {

  const classes = props.class
  return (
    <div className={style.hand}>
      <div className={style.fist}></div>
      <div className={style.finger} id={style.finger1}></div>
      <div className={style.finger} id={style.finger2}></div>
      <div className={style.finger} id={style.finger3}></div>
      <div className={style.finger} id={style.finger4}></div>
      <div className={style.thumb}></div>
      <div className={style.arm}></div>
    </div>

  )
}
